import Nav from 'react-bootstrap/Nav';
import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import LoginPage from '../pages/LoginPage';
import LogsPage from '../pages/LogsPage';
import RequireAuth from './RequireAuth';
import SignupPage from '../pages/SignupPage';
import LogoutPage from '../pages/LogoutPage';

function ListExample() {
  return (
    <BrowserRouter>
        <Nav defaultActiveKey="/home" as="ul" id="navbar">
            <Nav.Item as="li">
                <Nav.Link to="/">Dashboard</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link eventKey="link-1">Exercise</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link eventKey="link-2">Nutrition</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link eventKey="link-2">Log In</Nav.Link>
            </Nav.Item>
        </Nav>

        <Routes>
            <Route index element={<RequireAuth><LogsPage /></RequireAuth>} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/signup" element={<SignupPage />} />
            <Route path="/logout" element={<LogoutPage />} />
        </Routes>
    </BrowserRouter>
  );
}

export default ListExample;
